import java.util.Arrays;
import java.util.HashMap;

public class _2370LongestIdealSubsequence {
    public int longestIdealString(String s, int k) {
        int[] dp = new int[s.length()];
        Arrays.fill(dp, - 1);

        int ans = 0;
        for(int i = 0; i < s.length(); ++i){
            ans = Math.max(ans, helper(s, k, i, dp) + 1);
        }
        return ans;
    }

    public int helper(String s, int k, int idx, int[] dp) {
        if (idx == s.length()-1) {
            return dp[idx] = 0;
        }
        if(dp[idx] != -1){
            return dp[idx];
        }

        int ans = 0;

        for (int i = idx+1; i < s.length(); ++i) {
            if(Math.abs(s.charAt(idx) - s.charAt(i)) <= k){
                ans = Math.max(ans, helper(s, k, i, dp) + 1);

            }
        }
        return dp[idx] = ans;
    }

    public int longestIdealString2(String s, int k) {
        int[] dp = new int[s.length()];
        HashMap<Character, Integer> mp = new HashMap<>();
        dp[0] = 1;
        mp.put(s.charAt(0), 0);

        for(int i = 1; i < s.length(); ++i){
            
            char key = s.charAt(i);
            int closest = -1;
            for(int j = Math.max(0, key - 'a' - k); j <= Math.min(26, key - 'a' + k); ++j) {
                if(mp.containsKey((char)(j + 'a'))){
                    closest = Math.max(closest, dp[mp.get((char)(j + 'a'))]);
                }
            }

            if(closest == -1){
                dp[i] = 1;
            } else {
                dp[i] = closest + 1;
            }
            mp.put(s.charAt(i), i);
        }

        return Arrays.stream(dp).max().getAsInt();
    }



    public static void main(String[] args) {
        _2370LongestIdealSubsequence ob = new _2370LongestIdealSubsequence();
        System.out.println(ob.longestIdealString2("pvjcci", 4));
        System.out.println(ob.longestIdealString2("acfgbd", 2));
        System.out.println(ob.longestIdealString2("eduktdb", 15));
        System.out.println(ob.longestIdealString2("", 8));
    }
}
